// Obtener respuesta del upload de Supabase
const uploadResponse = items[0].json;

// Obtener datos del webhook
const webhookData = $('Webhook Trigger Imágenes IA').item.json;
const sessionId = webhookData.body.session_id || 'default';
const timestamp = new Date().getTime();
const date = new Date().toISOString().split('T')[0];

// El nombre real del archivo subido (Supabase devuelve esto en Key o Id)
const actualFileName = uploadResponse.Key || uploadResponse.Id || uploadResponse.path || `${date}/${timestamp}-${sessionId}.jpg`;

// Construir URL pública correcta
const publicUrl = `https://rrmafdbxvimmvcerwguy.supabase.co/storage/v1/object/public/imagenes/${actualFileName}`;

return {
  json: {
    success: true,
    id: actualFileName,
    name: actualFileName.split('/').pop(),
    fileName: actualFileName,
    fullPath: actualFileName,
    webViewLink: publicUrl,
    publicUrl: publicUrl,
    Key: actualFileName,
    bucket: 'imagenes',
    uploadedAt: new Date().toISOString(),
    originalResponse: uploadResponse
  }
};

